sys_variable_value.value:
(function execute(inputs, outputs) {
  var response = JSON.parse(inputs.responsebody);

  if(inputs.statuscode == "200")
  {
    var allVersionsArray = [];
    if(response.result.length != 0)
    {
      for(var n=0; n<response.result.length; n++)
      {
        allVersionsArray.push(response.result[n].newvalue);
        allVersionsArray.push(response.result[n].oldvalue);
      }
    }
    else {
      allVersionsArray.push("00.00.000");
    }

    var au = new global.ArrayUtil();
    var newAllVersionsArray = au.unique(allVersionsArray);

    outputs.statuscode = "0";
    outputs.versions = newAllVersionsArray;
  } 
  else 
  {
    outputs.statuscode = "1";
    outputs.error = inputs.errorMessage;
  }
})(inputs, outputs);

